import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navigation/Navbar';
import { useDispatch } from 'react-redux';
import { setFavoriteMovies } from './store/slices/favoriteMoviesSlice';
import Home from './Pages/Home';
import FavoritesPage from './Pages/Favorites';
import MovieDetailView from './Pages/MovieDetailView';

function App() {
  // const dispatch = useDispatch();

  // useEffect(() => {
  //   if (favoriteMovies?.results) {
  //     dispatch(setFavoriteMovies(favoriteMovies.results));
  //   }
  // }, [favoriteMovies, dispatch]);

  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/favorites" element={<FavoritesPage />} />
        <Route path="/movies/:movieId" component={<MovieDetailView />} />
      </Routes>
    </Router>
  );
}
export default App;
